/* funcion PARA EL CAMBIO DE SELECT DEL CONTACTENOS */
 function select_cambio(){

 	var select = document.getElementById('pais').value;

 	var seleccion_departamento = document.getElementById('seleccion_departamento');
 	var escribir_departamento = document.getElementById('escribir_departamento');
 	var contenedor = document.getElementById('escribir_departamento');
 	if(select == "Colombia"){
 		seleccion_departamento.className = 'select-visible';
 		seleccion_departamento.name = 'departamento';
 		escribir_departamento.className = 'select-invisible';
 		escribir_departamento.name = 'nada';
 	}
 	else{
 		seleccion_departamento.className = 'select-invisible';
 		seleccion_departamento.name = 'nada';

 		escribir_departamento.className = 'select-visible';
 		escribir_departamento.name = 'departamento';

 	}
 }

/* LIMITAR CARACTERES A SOLO NUMEROS */

function isNumberKey(evt){

			         var charCode = (evt.which) ? evt.which : event.keyCode

			         if (charCode > 31 && (charCode < 48 || charCode > 57))

			            return false;

			 

			         return true;

			}

